//--------------------------------------------------
// Description  : Sharpness Test
// Input Value  : None
// Output Value : _TEST_PASS or _TEST_FAIL
//--------------------------------------------------
bit ScalerQCSHPTest(void)
{
    BYTE ucData = 0;

    DebugMessageQC("5. SHP Start", 0x00);
    ScalerQCDDomainRandomGenOn(_MASS, _BIT_MODE_10);

    ScalerQCHighlightWindowOff();
    ScalerBurstWrite(tQC_SHP_SETTING, 146, GET_CURRENT_BANK_NUMBER(), P12_A0_SR_SHP_CTRL_0, _BURSTWRITE_COMMAND, _BURSTWRITE_FROM_FLASH);

    //1.SHP
    DebugMessageQC("5. Mode_0", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _IMD_CRC_D_AFTER_DDITHER, _M1, tQC_SHP_CRCTable_1, 1) << 0));

    //2.SHP + HLW Used Full Region
    ScalerQCHighlightWindowOn();
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0D_HLW_CONTROL1, ~(_BIT1 | _BIT0), 0x00); //full
    DebugMessageQC("5. Mode_1", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _IMD_CRC_D_AFTER_DDITHER, _M1, tQC_SHP_CRCTable_2, 1) << 1));

    //3.SHP + HLW Used Inside
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0D_HLW_CONTROL1, ~(_BIT1 | _BIT0), _BIT0); //inside
    DebugMessageQC("5. Mode_2", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _IMD_CRC_D_AFTER_DDITHER, _M1, tQC_SHP_CRCTable_3, 1) << 2));

    //4.SHP + HLW Used Outside
    ScalerSetDataPortBit(P0_60_HLW_ADDR_PORT, _P0_61_PT_0D_HLW_CONTROL1, ~(_BIT1 | _BIT0), _BIT1); //outside
    DebugMessageQC("5. Mode_3", 0x00);
    ucData = (ucData | ((BYTE)ScalerQCCRCCompare(_D_DOMAIN_CRC, _IMD_CRC_D_AFTER_DDITHER, _M1, tQC_SHP_CRCTable_4, 1) << 3));

    //Disable SHP
    ScalerSetByte(P12_A0_SR_SHP_CTRL_0, 0x00);

    ScalerQCDDomainPatternGenOff();
    ScalerQCHighlightWindowOff();

    DebugMessageQC("5. SHP End", 0x00);

    if(ucData == _TEST_PASS)
    {
        DebugMessageQC("6.====D Random SHP PASS====", 0x00);
        return _TEST_PASS;
    }
    else
    {
        DebugMessageQC("6.====D Random SHP Fail====", 0x00);
        return _TEST_FAIL;
    }
}

